  let { state, dispatch } = React.useContext(AppData);
  return (
    <React.Fragment>
      <section className="res-education res-editable" id="Education">
        <h2 className="note rr poly-wrap">Education</h2>
        <ul className="skewer">
          {/*
        <li class="rr add-tack">
		<span class="wrap">
			<h2>{{{name}}} <em>({{{type}}})<\/em></h2>
			<img src="assets/img/logos/{{{logo}}}" alt="{{{name}}} logo" />
			<dl class="pretty-scroll">
				<dt>Location: </dt>
				<dd>{{{location}}}</dd>
				<dt>Dates: </dt>
				<dd>{{{start}}} - {{{end}}}</dd>
				<dt>Degree: </dt>
				<dd>{{{degree}}}</dd>
				<dt>Awards: </dt>
				<dd>{{{awards}}}</dd>
				<dt>Detail: </dt>
				<dd>{{{description}}}</dd>
			</dl>
		</span>
</li>
*/}
        </ul>
      </section>
    </React.Fragment>
  );
};

export default Education;
